import React from 'react';
import {Link} from 'react-router-dom';

function Submit() {
  return (
    <Link to='Complete/' className='w-full flex justify-center items-center text-white py-3 rounded-lg' style={{background: 'hsl(278, 68%, 11%)'}} >Confirm</Link>
  )
}
export default Submit;
